import React from 'react';
import './ProfileCard.css';

const ProfileCard = () => {
    return (
        <div className="card-container">
            <span>ONLINE</span>
            <img src="" alt="Profile" />
            <h3>User Name</h3>
            <h3>City</h3>
            <p>Designation</p>
            <div>
                <button>Message</button>
                <button>Follow</button>
            </div>
        </div>
    );
};

export default ProfileCard;
